import React from 'react'
import { IProduct } from '../moduls'

interface ProductProps{
    product: IProduct
}

export function Home({product}: ProductProps){
    return (
        <div>
            {product.title}
            <br/>
            {product.description}
            <br/>
            {product.price}
            <br/>
            <img width={350} height={450}  src={product.imageMain} alt="" />
        </div>
    )
}
